componentDidMount = () => {
  this.loadAds();
};

loadAds = async () => {
  const response = await api.get("/ads");
  console.log(response);
  data = response.data;
};

async function handleSubmit(e) {
  // e.preventDefault();
  history.push("/home");
}

const buildAds = () => {
  <div>
    {data.map(item => {
      return (
        <Ads>
          <p>Títilo: {data.title}</p>
          <p>Descrição: {data.description}</p>
          <p>Autor: {data.author}</p>
          <p>Preço: {data.price}</p>
        </Ads>
      );
    })}
